import React from "react";
import logo from '../images/sapphirelogo.svg';
import { animateScroll as scroll } from "react-scroll";
import Services from './Tabs/Services';
import About from './Tabs/About';
import Philantrophy from './Tabs/Philantrophy';
import ResponsiveMenu from 'react-responsive-navbar';
import { FaBars, FaFile } from 'react-icons/fa';
import '../css/navbar.css';

const scrollToTop = () => { scroll.scrollToTop() }

const Navbar = () => {
  return (
    <ResponsiveMenu
      menuOpenButton={<FaBars size={30} />}
      menuCloseButton={<FaFile size={30} />}
      changeMenuOn="40em"
      largeMenuClassName='nav top-bar'
      smallMenuClassName=''
      className='nav'
      menu={
        <div className='nav-content'>
          <div className='top-bar-left nav-items'>
            <Services />
            <About />
            <Philantrophy />
          </div>
          <div className='top-bar-right'>
            <img src={logo}
              className='nav-logo'
              alt='logo'
              onClick={scrollToTop} />
          </div>
        </div>
      }
    />
  );
}

export default Navbar;
